import React, { Component } from 'react'

import Tweets from '../posts/Posts'

class Dashboard extends Component {
    render(){
        return (
            <div className="dashboard container">
              <div className="row">
                <div className="col s10 m8" styles={{marginLeft: 20}}>
                    <Tweets />
                </div>
              </div>
            </div>
        )
    }
}

export default Dashboard
